import "./MyPage.scss";

import { NFTList } from "../main";
import axios from "axios";

function MyPage({ address, user }) {
  const [MyData, SetMyData] = useState(false);
  console.log(address);
  console.log(user);

  useEffect(() => {
    const getUserData = async () => {
      if (user !== false) {
        await axios
          .get("http://localhost:8080/vefiry", {
            headers: {
              Authorization: "Bearer " + user,
            },
          })
          .then((result) => {
            console.log(result);
          });
      } else {
        console.log(address);
      }
    };
    getUserData();
  }, []);
